import Form from "./Form.js";
import List from "./List.js";
import {useState} from "react";

function Contacts(){
  const [contacts,setContact] = useState([
    {
      fName:"Eralp",
      cellNumber:"5373580708"
    },

    {
      fName:"Enes",
      cellNumber:"5369784138"
    },

    {
      fName:"Sema",
      cellNumber:"5533174132"
    }
  ]);

   return(
     <div>
     <List
     contacts={contacts}
     />
     <Form
     contacts={contacts}
     addContact={setContact}
     />

     </div>




   )
}
export default Contacts;
